import React from 'react';
import { View, Text, KeyboardAvoidingView} from 'react-native';


export default function Login() {
      
    return (
        <KeyboardAvoidingView>

          <View>           
           <Image
               source={require('')}
           />
           </View>

         <View>
            <TextInput
               placeholder="Email"
               autoCorrect={false}
               onChangeText={()=> {}}
            />
        
            <TextInput
               placeholder="Senha"
               autoCorrect={false}
               onChangeText={()=> {}}
            />

            <TouchableOpacity>
               <Text>Acessar</Text>
            </TouchableOpacity>

            <TouchableOpacity>
              <Text>Crie sua conta</Text>
            </TouchableOpacity>

    
          </View>         
        </KeyboardAvoidingView>
    
    );
}
